import { useRouter } from 'next/router'
import useSWR from 'swr'

export default function Books() {
  const router = useRouter();
  const { data, error } = useSWR('/api/test')


  return <>
    <h1>{JSON.stringify(router)}</h1>
    <h1>{JSON.stringify(data)}</h1>
    </>
}
